import logo from './logo.svg';

import RoutesFunc from './routes';
import Debug from './Components/Debugging/debug';
import Test from './Components/Debugging/test';
import { FormProvider } from "./Components/Redux/FormContext"

import { Provider } from 'react-redux';
import { configureStore } from '@reduxjs/toolkit';
import rootReducer from '../src/Components/Redux/reducer';


const store = configureStore({
  reducer: rootReducer,
  // Add middleware, devtools, etc. if needed
});

function App() {
  return (
    //<FormProvider>
    //  <RoutesFunc />
    //</FormProvider>
    <Provider store={store}>
      <RoutesFunc />
    </Provider>
  );
}

export default App;
